import Container from '@mui/material/Container';
import Box from '@mui/material/Box';
import TypeIt from 'typeit-react';

const Home = () => {
    return (
        <main>
            <div className="container">
                <Container maxWidth="md">
                    <Box sx={{ bgcolor:'#fbbf24' , height:'100vh'}}></Box>
                </Container>
            </div>

            <Box  className="div-body mt-5" sx={ { fontWeight : 'bold', textAlign : 'center', pt : 4, px : 15 }}>
                <TypeIt
                    options={{ 
                        strings : ["'People say the longest sentence to ever be printed in literature belongs to Victor Hugo. The claim is that in Les Misérables there is a sentence which is 823 words long.'"],
                        speed : 50,
                        waitUntilVisible : true,
                        loop : true,
                     }}
                />
            </Box>
        </main>
    );
}

export default Home;
